b'Ilkay G\xc3\xbcndogan has added to his goal last time out with a brace tonight as Germany end qualifying with 27/30 points.

Aymeric Laporte, Rodri, R\xc3\xbaben Dias, Jo\xc3\xa3o Cancelo, and Bernardo Silva were also in action, with the latter getting an assist.

